def test_tfds_similarity():
    """Test fingerprint similarity detection"""
    # Full training subset
    d_full = TfdsDataset(mnist_info, mnist_train_ds)

    # Half training subset
    d_half = TfdsDataset(mnist_info, mnist_train_ds.take(500))

    # Test subset
    d_test = TfdsDataset(mnist_info, mnist_test_ds)

    # Combined train + test
    d_combined = TfdsDataset(
        mnist_info, mnist_train_ds.concatenate(mnist_test_ds)
    )

    # Identical datasets (100% similarity)
    assert_fingerprint_similarity(d_full, d_full, 1.0)

    # Dataset vs half (50% similarity)
    assert_fingerprint_similarity(d_full, d_half, 0.5)

    # Train vs test - no overlap (0% similarity)
    assert_fingerprint_similarity(d_full, d_test, 0.0)

    # Combined vs test: 500/1500 = 0.33 similarity
    assert_fingerprint_similarity(d_combined, d_test, 0.33)


def test_tfds_serialization():
    """Test round-trip serialization/deserialization"""
    # Get single data point
    data_point = next(iter(mnist_test_ds))

    dataset = TfdsDataset(mnist_info, mnist_test_ds)

    # Serialize
    serialized = dataset.serialize_data_point(data_point)

    # Deserialize
    deserialized = dataset.deserialize_data_point(serialized)

    # Verify all features present
    assert set(deserialized.keys()) == set(data_point.keys())

    # Verify each feature matches
    for key in data_point.keys():
        original = data_point[key]
        restored = deserialized[key]

        # Type check
        assert isinstance(restored, tf.Tensor)

        # Shape and dtype check
        assert original.shape == restored.shape
        assert original.dtype == restored.dtype

        # Value check using numpy
        np.testing.assert_array_equal(
            np.asarray(original),
            np.asarray(restored)
        )


def test_tfds_variable_length():
    """Test variable-length feature serialization"""
    # Create mock feature info with variable-length shape
    var_features = {
        'text': tfds.features.Tensor(shape=(None,), dtype=tf.int32),
        'label': tfds.features.ClassLabel(num_classes=2)
    }
    var_feature_info = types.SimpleNamespace(features=var_features)

    # Create data points with different lengths
    var_data = [
        {
            'text': tf.constant([1, 2, 3, 4, 5], dtype=tf.int32),
            'label': tf.constant(0, dtype=tf.int64)
        },
        {
            'text': tf.constant([1, 2], dtype=tf.int32),  # Different length
            'label': tf.constant(1, dtype=tf.int64)
        }
    ]

    dataset = TfdsDataset(var_feature_info, var_data)

    # Test each data point round-trip
    for data_point in var_data:
        serialized = dataset.serialize_data_point(data_point)
        deserialized = dataset.deserialize_data_point(serialized)

        # Verify reconstruction
        for key in data_point.keys():
            np.testing.assert_array_equal(
                np.asarray(data_point[key]),
                np.asarray(deserialized[key])
            )
